
<!DOCTYPE html>
<html>
<head>
    <title>Inkscape Output</title>
</head>
<body>
    <canvas id='canvas' width='12' height='12'></canvas>
    <script>
    var ctx = document.getElementById("canvas").getContext("2d");
    	
// #layer1
	ctx.save();
	ctx.transform(1.000000, 0.000000, 0.000000, 1.000000, -74.155397, -112.541770);
	
// #path4135
	ctx.beginPath();
	ctx.strokeStyle = 'rgb(0, 0, 0)';
	ctx.miterLimit = 4;
	ctx.lineWidth = 0.055573;
	ctx.fillStyle = 'rgb(221, 221, 221)';
	ctx.arc(80.155396, 118.541820, 5.901545, 0.000000, 6.28318531, 1);
	ctx.fill();
	ctx.stroke();
	ctx.restore();

    </script>
</body>
</html>
